-- View [dbo].[CountryCurrencyInfo]
CREATE VIEW [dbo].[CountryCurrencyInfo]
AS
SELECT c.Id AS CountryId, c.ISO2 AS CountryISO2, c.ISO3 AS CountryISO3, c.ISONumeric AS CountryISONumeric, c.Name AS CountryName,
   cu.Id AS CurrencyId, cu.Name AS CurrencyName, cu.Code AS CurrencyCode
FROM dbo.CountryCurrency AS cc
RIGHT OUTER JOIN dbo.Country AS c
ON cc.CountryId = c.Id
LEFT OUTER JOIN dbo.Currency AS cu
ON cc.CurrencyId = cu.Id
GO

--  View [dbo].[CountryInfo]
CREATE VIEW [dbo].[CountryInfo]
AS
SELECT country.Id, country.ISO2, country.ISO3, country.ISONumeric, country.Name, country.ISOName, country.OfficialName, country.Capital,
   continent.Name AS ContinentName, callingCode.CallingCodeNumber
FROM dbo.Country AS country
LEFT OUTER JOIN dbo.Continent AS continent
ON country.ContinentId = continent.Id
LEFT OUTER JOIN dbo.CallingCode AS callingCode
ON callingCode.Id = country.CallingCodeId
GO

-- View [dbo].[CountryTimeZoneInfo]
CREATE VIEW [dbo].[CountryTimeZoneInfo]
AS
SELECT tz.TimeZoneAcronym, tz.TimeZoneName, tz.UtcOffset, tz.DST, c.ISO2 AS CountryISO2, c.Name AS CountryName
FROM dbo.CountryTimeZone as ctz
INNER JOIN dbo.Country AS c
ON ctz.CountryId = c.Id
INNER JOIN dbo.TimeZone AS tz
ON ctz.TimeZoneId = tz.Id
GO

